fects V2','128341','Pulse Cloud Defects Workflow'),('227269','325801','jira','ProjectImport','','','1444881166926','Wed Oct 14 22:52:46 CDT 2015'),('338391','388319','jira','Project','11000','Bon Echo','11001','V11'),('338392','388319','jira','Key',NULL,'BE-2112',NULL,'VEL-1318'),('338393','388319','jira','Version',NULL,NULL,'11617','Nexia 2.0'),('338394','388319','jira','Version','11403','Nexia 2.0',NULL,NULL),('360094','395424','jira','Fix Version',NULL,NULL,'11631','Bon Echo'),('363930','398197','jira','description',NULL,'Issue 1 :\nSteps to reproduce:\n1. Login in to application.\n2. Go to Clinial settings.\n3. Create two Managed Care Templates (Ex: Mct1 and Mct2)\n4. Search a patient.\n5. Click More tab -> Managed Care.\n6. Add one Mct1 to patient chart.\n7. Click Problem list link.\n\nExpected : If \'Track this condition\' is selected, the system displays Managed care template and Baseline date fields\n\nActual : The Managed care template and Baseline date fields are displayed even if \'Track this condition\' is not checked.\n\nRefer Screen shots: Spec1.jpg, UnCheck.jpg\n\nIssue 2 :\nSteps to reproduce:\n8. Follow steps 1 to 7 in previous case.\n9. Check the \'Track this condition\' check box.\n10.Search for the Managed cared template (Ex: Mct)\n\nExpected :The Search result must include only templates not used in the current patient chart as <Template name> (<Created by user first and last names>).\n\nActual : The Search result includes the templates used in the current patient chart also. And only the <Template name> is displayed and not the (<Created by user first and last names>). \n\nRefer Screen shots: Spec1.jpg, NoName.jpg, joint.jpg\n\nIssue 3 :\nSteps to reproduce:\n11. Follow steps 1 to 10 in previous case.\n12. Save the Problem List.\n13. Again click the Problem list link.\n14. Click Edit option for the created Problem list.\n\nExpected :The user must not able to un-select Track this condition check box. The system automatically un-selects it if the user deletes the Managed care flowsheet.\n\nActual : But the Track this condition check box is editable.\n\nRefer Screen shots: Spec1.jpg',NULL,'Steps to reproduce:\n1. Login in to application.\n2. Go to Clinial settings.\n3. Create two Managed Care Templates (Ex: Mct1 and Mct2)\n4. Search a patient.\n5. Click More tab -> Managed Care.\n6. Add one Mct1 to patient chart.\n7. Click Problem list link.\n8. Follow steps 1 to 7 in previous case.\n9. Check the \'Track this condition\' check box.\n10.Search for the Managed cared template (Ex: Mct)\n\nExpected :The Search result must include only templates not used in the current patient chart as <Template name> (<Created by user first and last names>).\n\nActual : The Search result includes the templates used in the current patient chart also. And only the <Template name> is displayed and not the (<Created by user first and last names>). \n\nRefer Screen shots: Spec1.jpg, NoName.jpg, joint.jpg\n\nSteps to reproduce:\n11. Follow steps 1 to 10 in previous case.\n12. Save the Problem List.\n13. Again click the Problem list link.\n14. Click Edit option for the created Problem list.\n\nExpected :The user must not able to un-select Track this condition check box. The system automatically un-selects it if the user deletes the Managed care flowsheet.\n\nActual : But the Track this condition check box is editable.\n\nRefer Screen shots: Spec1.jpg'),('363931','398197','jira','Fix Version',NULL,NULL,'11632','Chutes'),('363932','398197','jira','Fix Version','11631','Bon Echo',NULL,NULL),('363933','398197','jira','priority','3','High','4','Medium'),('363934','398197','jira','assignee','jwang','Jason Wang',NULL,NULL),('494070','493147','jira','priority','10004','Medium','4','P3-Minor'),('411829','429956','jira','ProjectImport','','','1444883339212','Wed Oct 14 23:28:59 CDT 2015'),('432214','443324','jira','Link',NULL,NULL,'VEL-3231','This issue clones VEL-3231'),('432217','443327','jira','project','11001','V11','11800','Miratech'),('432