patient and go to update demographic section.\n3) Click on other payer and Add the payer created in step #1.\nSelect the payer type as Auto or Other or Worker\'s comp\n4)Search the same patient > mouse hover it > Click on post charges link in patient actions list\n5) Select New post charges on right side and navigate to charge entry window.\n6)Click on check box Accident related Charge.\n7)Select Employment or Auto or Other depend on what payer payer type we selected in Step #3.\n\nActual Result :Medical payers list are getting displayed instead of other payers.\nOther payer are not getting displayed in other payers widget.\n\nExpected Result : Other payer should be displayed in other payers widget.\n\nEnvironment : QA3/External(EH1480/doctor/orthodoc)\nVersion: 2.0-SNAPSHOT\nRelease Date: May 13, 2014\nBrowser: firefox 27.0',NULL,'For both US & Canada Views - the Select pop-up in the payers box should show ALL ACTIVE payers.  The current medical payers should show first, then a line in the box and the \"other\" payers underneath.  The user should be able to select one or more payers from the list to add to the claim. See the screen shot attached.  \n\nThis is the original problem as reported by Rula: \n 1)Actions >System settings > Directories >Add a new payer (manually)\n   Ensure that Payer should not be an OHIP or any other CA provincial    payer\n\n2)Search any patient and go to update demographic section.\n3) Click on other payer and Add the payer created in step #1.\nSelect the payer type as Auto or Other or Worker\'s comp\n4)Search the same patient > mouse hover it > Click on post charges link in patient actions list\n5) Select New post charges on right side and navigate to charge entry window.\n6)Click on check box Accident related Charge.\n7)Select Employment or Auto or Other depend on what payer payer type we selected in Step #3.\n\nActual Result :Medical payers list are getting displayed instead of other payers.\nOther payer are not getting displayed in other payers widget.\n\nExpected Result : Other payer should be displayed in other payers widget.\n\nEnvironment : QA3/External(EH1480/doctor/orthodoc)\nVersion: 2.0-SNAPSHOT\nRelease Date: May 13, 2014\nBrowser: firefox 27.0\n\n----\n\n* Hard Copy was broken\n# didn\'t reflect secondary setttings from system settings -> directories\n# could uncheck patient as payer, even without master-payer'),('219069','318403','jira','Attachment','24726','2015-09-04 15_42_11-Nightingale.png',NULL,NULL),('219068','318404','jira','Attachment',NULL,NULL,'24726','2015-09-04 15_42_11-Nightingale.png'),('219269','318556','jira','timeestimate','1200','1200','0','0'),('219270','318556','jira','timespent',NULL,NULL,'144000','144000'),('219271','318556','jira','WorklogId','18212','18212',NULL,NULL),('219272','318557','jira','status','10017','In Progress','10603','In Review'),('219273','318557','custom','GitHub Pull Request URL',NULL,'https://github.com/Medrium/Nexia/pull/8159',NULL,'https://github.com/Medrium/Nexia/pull/13015'),('219275','318557','jira','resolution',NULL,NULL,'10103','Fixed'),('219518','318712','jira','status','10603','In Review','10601','Awaiting Deployment'),('219535','318723','jira','status','10601','Awaiting Deployment','10606','Test'),('219536','318724','jira','resolution','10103','Fixed','10300','Not Fixed'),('219537','318724','jira','status','10606','Test','4','Reopened'),('219544','318729','jira','Fix Version',NULL,NULL,'14100','10.0.10'),('219545','318729','jira','Fix Version','14001','10.0.9',NULL,NULL),('219546','318730','jira','status','4','Reopened','10017','In Progress'),('230485','329016','jira','Link',NULL,NULL,'VEL-8106','This issue has Epic VEL-8106'),('230486','329017','jira','Link',NULL,NULL,'VEL-1127','This issue clones VEL-1127'),('466505','469528','jira','status','10017','In Progress','10603','In Review'),('466506','469528','jira','resolution','10303','Not Fixed','1','Fixed'),('472849','473676','jira','status','10603','In Review','10601','Awaiting De