doc'),('463128','466976','jira','Attachment','41600','SRS_REG_Patient Details_Payers_Rev0.2.doc',NULL,NULL),('463136','466984','jira','Attachment',NULL,NULL,'41603','SRS_SCH_Real Time Eligibility_Rev0.0.docx'),('463333','467121','jira','Attachment','41602','SRS_REG_Patient Details_Payers_Rev0.2.doc',NULL,NULL),('464588','468016','jira','description',NULL,'As a front-office user I need to see the patient\'s eligibility status as the patient is checking in so i know if i need to get updated information from the patient.\n\n* if the eligibility has not been run in a while the user will submit a real-time request if available. \n\n* If the real-time eligibility request is no available for that payer, the user might go online to the patient portal.  When the user clicks check eligibility and the payer does not support the electronic check, the user see\'s the payer portal website an can click on it to open a new window. Then the user can enter the results in the same pop-up window.\n\n* Provide a button to take the user directly into the patient\'s payers page to adjust the payers based on the patient\'s feedback.  Example, the eligibility status indicates failed, the patient confirms they no longer have that insurance, but have a different insurance instead.  The user will go to the patient payers, term out the old one, add the new one, and back to the check-in process.  From here the user can submit a new eligibility check for the payer that was just entered.\n\n* \n\n\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \n',NULL,'As a front-office user I need to see the patient\'s eligibility status as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n* if the eligibility has not been run in a while the user will submit a real-time request if available. \r\n\r\n* If the real-time eligibility request is no available for that payer, the user might go online to the patient portal.  When the user clicks check eligibility and the payer does not support the electronic check, the user see\'s the payer portal website an can click on it to open a new window. Then the user can enter the results in the same pop-up window.\r\n\r\n* Provide a button to take the user directly into the patient\'s payers page to adjust the payers based on the patient\'s feedback.  Example, the eligibility status indicates failed, the patient confirms they no longer have that insurance, but have a different insurance instead.  The user will go to the patient payers, term out the old one, add the new one, and back to the check-in process.  From here the user can submit a new eligibility check for the payer that was just entered.\r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n'),('464592','468020','jira','Link',NULL,NULL,'VTEN-1723','This issue is cloned by VTEN-1723'),('464595','468023','jira','summary',NULL,'Check-in Window: Show patient payers at bottom of first window & eligibility status',NULL,'Check-in Window: Show patient payers at bottom of first window '),('464596','468024','jira','description',NULL,'As a front-office user I need to see the patient\'s eligibility status as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n* if the eligibility has not been run in a while the user will submit a real-time request if available. \r\n\r\n* If the real-time eligibility request is no available for that payer, the user might go online to the patient portal.  When the user clicks check eligibility and the payer does not support the electronic check, the user see\'s the payer portal website an can click on it to open a new window. Then the user can enter the results in the same pop-up window.\r\n\r\n* Provide a button to take the user directly into the patient\'s payers page to adjust the payers based on the patient\'s feedback.  Example, the eligibility status indicates failed, the patient confirms they no longer have that insurance, but have a different insurance instead.  The user will go to the patient payers, term out the old one, add the new one, and back to the check-in process.  From here the user can submit a new eligibility check for the payer that was just entered.\r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n',NULL,'As a front-office user I need to see the patient\'s payers as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n'),('464597','468024','jira','Fix Version',NULL,NULL,'11132','10.0.10'),('464598','468024','jira','Fix Version','11111','V10 Backlog',NULL,NULL),('464599','468025','jira','Attachment','41603','SRS_SCH_Real Time Eligibility_Rev0.0.docx',NULL,NULL),('464600','468026','jira','Attachment','30642','man elig pop.pdf',NULL,NULL),('464602','468028','jira','description',NULL,'As a front-office user I need to see the patient\'s payers as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n',NULL,'As a front-office user I need to see the patient\'s payers as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n* Provide a button to take the user directly into the patient\'s payers page to adjust the payers based on the patient\'s feedback.  Example, the eligibility status indicates failed, the patient confirms they no longer have that insurance, but have a different insurance instead.  The user will go to the patient payers, term out the old one, add the new one, and back to the check-in process.  \r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n'),('464603','468029','jira','description',NULL,'As a front-office user I need to see the patient\'s payers as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n* Provide a button to take the user directly into the patient\'s payers page to adjust the payers based on the patient\'s feedback.  Example, the eligibility status indicates failed, the patient confirms they no longer have that insurance, but have a different insurance instead.  The user will go to the patient payers, term out the old one, add the new one, and back to the check-in process.  \r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n',NULL,'As a front-office user I need to see the patient\'s payers as the patient is checking in so i know if i need to get updated information from the patient.\r\n\r\n* Provide a button to take the user directly into the patient\'s payers page to adjust the payers based on the patient\'s feedback.  Example, the eligibility status indicates failed, the patient confirms they no longer have that insurance, but have a different insurance instead.  The user will go to the patient payers, term out the old one, add the new one, and back to the check-in process.  \r\n\r\nSee the prototype here: https://rd.nexiaemr.com/staging/scheduling/scheduling.html \r\n\r\nThis was already done in bon echo/v11 and some of the functionality may be ported from that code.  \r\n'),('464718','468121','custom','Sprint',NULL,NULL,'97','10.0.10 S1'),('465079','468399','custom','Rank','','','','Ranked lower'),('465205','468513','custom','Story Points',NULL,NULL,NULL,'5'),('465897','469054','jira','status','10602','In Design','1','New'),('465898','469055','jira','assignee','kbartholomae','Bartholomae, Kimberly',NULL,NULL),('466510','469532','jira','Link',NULL,NULL,'VTEN-1742','This issue relates to VTEN-1742'),('467417','470189','jira','assignee',NULL,NULL,'rkhoury','Khoury, Rula'),('467419','470191','jira','Link',NULL,NULL,'VTEN-1760','This issue is blocked by VTEN-1760'),('468125'