thing like this :\n{color:red}Failed to Translate for Charge Group Info because there is no record of payer Claim with - accountid : 1004578, payer id : 2 {color}\n\n\n- when leaving a payer wizard page without saving claim info, showing an alert message such as \'Default claim settings info will be saved\' with ok button and it can be a fix this issue.\n',NULL,'Create a new payer \n- system settings -> Directories -> Add New -> Fill out form -> click Save\n- now It will show the page of claim settings in Payer Wizard\n- click menus out of payer page such as \'Directories\' or Nightingale menu at right top instead of click Next or Done button.\n- now create a charge by using this payer \n- go to claim history and check the claim you just posted.\n\nit will show error message something like this :\n{color:red}Failed to Translate for Charge Group Info because there is no record of payer Claim with - accountid : 1004578, payer id : 2 {color}\n\n\n- when leaving a payer wizard page without saving claim info, showing an alert message such as \'Default claim settings info will be saved\' with ok button and it can be a fix this issue.\n[~kbartholomae] Kim, can you confirm if this fix work for you ?\n'),('221089','319790','jira','assignee',NULL,NULL,'rkim','Ryan Kim'),('221575','320112','jira','status','10017','In Progress','10603','In Review'),('221576','320112','custom','Root Cause',NULL,NULL,NULL,'- changed code to create a default payer claim when payer is created which wlil fix this issue for new payer\n- for existnig payer, added a query to add a default payer claim'),('221577','320112','custom','GitHub Pull Request URL',NULL,NULL,NULL,'https://github.com/Medrium/Nexia/pull/13255'),('221578','320112','jira','resolution',NULL,NULL,'10103','Fixed'),('221574','320113','jira','status','1','New','10017','In Progress'),('462984','466865','jira','status','10603','In Review','10601','Awaiting Deployment'),('462985','466866','jira','status','10601','Awaiting Deployment','10606