k	           \nThe system cancels the process and returns to the previous page. Refer to SRS_ManageWorkQueue_Tasks\n\nCancel	  on  Chart Disclosure Request 	\nThe system cancels the process and returns to the previous page.\n\nCancel	 on  Select Chart Items	      \n The system displays a generic pop-up message Are you sure you want to cancel this action? with Yes/No buttons. If the user selects Yes button in the pop-up message, the system cancels all the changes done to the page and returns to the Chart Disclosure Request page.\n\nCancel	on  Review Chart Disclosure	      \n The system displays a generic pop-up message Are you sure you want to cancel this action? with Yes/No buttons. If the user selects Yes button in the pop-up message, the system cancels all the changes done to the page and returns to the Chart Disclosure Request page.\n\n\n\n','2014-03-26 18:28:41','achanney','2014-03-26 18:36:32',NULL),('171290','66678','tstroe','comment',NULL,NULL,'For all the \"Cancel\" buttons the system will behave the same way:\nDisplay the Are you sure you want to cancel the chart disclosure process? with Y/N buttons. If the user selects Yes button in the pop-up message, the system cancels all the changes done to the page and returns to the page that was accessed before the beginning of the chart disclosure process.','2014-03-27 15:21:08','tstroe','2014-03-27 15:21:08',NULL),('191367','78479','jyanez','comment',NULL,NULL,'\n\n[^1rst Health Staff List as of 10.30.15.xlsx] _(18 kB)_','2015-11-02 15:30:52','jyanez','2015-11-02 15:30:52',NULL),('192368','78479','jyanez','comment',NULL,NULL,'We are in the process of getting a final user list for setting up the user accounts.  Please disregard (or remove if you have the security) the existing attachment dated 11/2/15.  ','2015-11-12 16:24:06','jyanez','2015-11-12 16:24:06',NULL),('192401','78479','rthieszen','comment',NULL,NULL,'Created the following accounts/passwords:\n1rst_documents/Public2000!\n1rst_portal/Public2000!\n1rst_service/Public2000!','2015-11-13 09:43:59','rthieszen','2015-11-13 09:43:59',NULL),('192402','78479','rthieszen','comment',NULL,NULL,'Removed attachment as requested.','2015-11-13 09:44:27','rthieszen','2015-11-13 09:44:27',NULL),('193443','78479','lmoore','comment',NULL,NULL,'[~rthieszen] - in looking at the timeline for 1rst Health, we will need them to have access to citrix by Thursday of this week so they can begin validation of the conversion data.  Please let me know if there is any issue with this timeline.','2015-11-30 15:12:01','lmoore','2015-11-30 15:12:01',NULL),('193712','78479','rthieszen','comment',NULL,NULL,'[^1rst Health user account list.xlsx]','2015-12-02 12:38:20','rthieszen','2015-12-02 12:38:20',NULL),('193713','78479','rthieszen','comment',NULL,NULL,'User accounts created - see attached.','2015-12-02 12:38:54','rthieszen','2015-12-02 12:38:54',NULL),('170462','66050','danielhan','comment',NULL,NULL,'For now, I\'ll make rejection disappear only if payment was posted after rejection appeared in queue to cover concern below.\n\nA Concern,\nfor a patient, Primary-Patient-Payer and Secondary-Patient-Payer has same payer.\nPayment applied for Primary-Patient-Payer, Rejection for Secondary-Patient-Payer.\nWe don\'t know if rejection was for primary or secondary because they are from same payer, same case for payment.\n\n\nIf we need to cover case of making payment before being rejected to not appear in queue...\nMaybe give user ability to remove rejection alerts from queue?','2015-08-13 15:41:03','danielhan','2015-08-14 14:33:56',NULL),('170463','66050','kbartholomae','comment',NULL,NULL,'By the way, [~DanielHan] - there is an indication in the payment if that is a primary or secondary payment.  ','2015-08-14 17:00:23','kbartholomae','2015-08-14 17:00:23',NULL),('170467','66050','jenkinsjirabot','comment',NULL,NULL,'This ticket has been reviewed by vitorbertazoli and is waiting for the next build.\n\nTo view the pull request, see https://github.com/Medrium/Nexia/pull/12890','2015-08-17 09:22:06','jenkinsjirabot','2015-08-17 09:22:06',NULL),('170477','66050','danielhan','comment',NULL,NULL,'IN SHORT: Couldn\'t find data indication primary or secondary.\n\nGave it another look to find primary/secondary in the payment.\nWe don\'t always know which patient-payer, but we do know payer,\nNo data indicating primary or secondary found. (Unless it can be inferred by another field)\n\nERA -> Primary/secondary information from ERA is not reliable; We try to match by member ID in this case, if that fails as well,,,, well... we pick first patient-payer of paid payer.\n\n\nI guess we should start saving which patient-payer paid in payment instead of just payer.\n(If I have time after finishing up other bugs, I\'ll put more time in this)','2015-08-17 13:33:07','danielhan','2015-08-17 15:33:41',NULL),('170529','66050','abrowne','comment',NULL,NULL,'Tested and passed in QA 1.\nPaid claims are now being removed from the rejection queue.','2015-08-20 14:41:18','abrowne','2015-08-20 14:41:18',NULL),('180262','71284','ewilliams','comment',NULL,NULL,'Tested on QA3, seems ok. Could you please test again?','2014-10-14 16:34:55','ewilliams','2014-10-14 16:34:55',NULL),('180321','71284','khossain','comment',NULL,NULL,'Passed. \n\nTest environment: \nDate: Wed Oct 15 15:19:45 GMT-400 2014\nVersion: 2.0.1\nBuild: caabe1b251\nAccount: 1000666\nUser: TESTBOOKING\nPractice: 2\nRole: 7\nNametoken: !LabReportRequest\nURL: https://10.1.13.41:8443/?locale=en_CA#!chartEncounter;patientID=34539;encounterID=19116;appointmentID=-1\nBrowser: Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 Safari/537.36\n','2014-10-15 15:21:09','khossain','2014-10-15 15:21:09',NULL),('192390','78487','gwilliams','comment',NULL,NULL,'Install Pulse application: \n1rst-CTX01 (172.20.26.11)','2015-11-13 07:42:13','gwilliams','2015-11-13 07:42:13',NULL),('192407','78487','gwilliams','comment',NULL,NULL,'Completed installation of