6048','schawla','comment',NULL,NULL,'This defect is part of the story VTEN-1389.\r\n\r\nPlease find the attached screenshots <<Medical payers.docx>> for reference for the Medical Widget options.\r\n\r\nVerified in Dev01 environment ; Version: 10.1 ; Release Date:11/21/2015','2015-11-23 14:56:22','schawla','2015-11-23 14:56:22',NULL),('127179','43089','rthieszen','comment',NULL,NULL,'Connected to client and found that SecureLink Gatekeeper service was stopped.  Started service.','2015-02-05 13:38:14','rthieszen','2015-02-05 13:38:14',NULL),('127181','43089','rthieszen','comment',NULL,NULL,'The Securelink Gatekeeper service was stopped on their server.  It has been started and is now running.  You can connect with SecureLink.','2015-02-05 13:39:17','rthieszen','2015-02-05 13:39:17',NULL),('195918','66228','kbartholomae','comment',NULL,NULL,'\r\nFrom: Kuznetsova, Irina \r\nSent: Friday, December 18, 2015 9:58 AM\r\nTo: Bartholomae, Kimberly <kbartholomae@pulseinc.com>; Liu, Jamie <jliu@pulseinc.com>\r\nCc: Chen, Hanson <hchen@pulseinc.com>; Kar, Eric <ekar@pulseinc.com>\r\nSubject: VTEN-1515\r\n\r\nHi Kim,\r\nbased on spec, system should display \"total number of patients under current failed eligibility queue\".\r\nSince we know that the same patient can be displayed multiple times in the queue could you clarify is this total number of patients or its total number of records.\r\n','2015-12-18 08:59:56','kbartholomae','2015-12-18 08:59:56',NULL),('195954','66228','kbartholomae','comment',NULL,NULL,'[~ikuznetsova], [~jliu] - \r\nYou can modify the queue to show the number of appointments rather than patients. \r\n\r\nAlso, for the eligibility result, show the most recent result in the list view, since we are not capturing the request information or sending the eligibility date requested.  We will change this once we are able to store this information. ','2015-12-18 11:26:30','kbartholomae','2015-12-18 11:26:30',NULL),('195994','66228','kbartholomae','comment',NULL,NULL,'From: Kuznetsova, Irina \r\nSent: Friday, December 18, 2015 3:06 PM\r\nTo: Bartholomae, Kimberly <kbartholomae@pulseinc.com>; Liu, Jamie <jliu@pulseinc.com>\r\nCc: Chen, Hanson <hchen@pulseinc.com>; Kar, Eric <ekar@pulseinc.com>\r\nSubject: re: VTEN-1515 - failed eligibility queue\r\n\r\nKim,\r\nshould system search appointment in the Fail eligibility queue  by \r\n- patient DOB\r\n- patient primary contact#\r\n- patient visit date\r\n','2015-12-18 14:15:30','kbartholomae','2015-12-18 14:15:30',NULL),('195995','66228','kbartholomae','comment',NULL,NULL,'[~ikuznetsova] The search box should allow for user to search/filter by  patient name, patient ID & payer name.  This is in the body of the ticket above.  \r\nAlso, please put questions in the ticket for traceability. \r\nthanks','2015-12-18 14:17:04','kbartholomae','2015-12-18 14:17:04',NULL),('196077','66228','jliu','comment',NULL,NULL,'found a  problem:\r\n		the DateBox\'s DateChangeEvent was fired twice when a user pick a date from the date box\r\n			this was a known bug in GWT, but not fixed yet, according to\r\n			https://code.google.com/p/google-web-toolkit/issues/detail?id=4785\r\n		reason:\r\n			in DateBox.DateBoxHandler.onValueChange(),\r\n				setValue(parseDate(false), event.getValue(), true); \r\n					fires the DateChangedEvent\r\n				hideDatePicker()\r\n					fires the DateChangedEvent again\r\n					because the old value has hours to be \'12\', while the new value has hours to be \'00\'\r\n		solution 1: \r\n			add override method setValue(Date, boolean) to FormDateBox.java, \r\n				to set all hours,minutes and seconds to be 0, so that the date changed event won\'t be fired twice\r\n			but it didn\'t work\r\n			because this method was not called during date change\r\n		solution 2:\r\n			add override method onValueChange(ValueChangeEvent<Date> event) to FormDateBox.java, \r\n				to set all hours,minutes and seconds to be 0, so that the date changed event won\'t be fired twice\r\n\r\n			but it didn\'t work\r\n			because this method is private\r\n		solution 3:\r\n			extend DatePicker.java, and  override setValue(Date newValue, boolean fireEvents)\r\n				to set all hours,minutes and seconds to be 0\r\n				and then set it in the constructor of FormDateBox.java\r\n			but it didn\'t work\r\n			because this method is final!!!\r\n		solution 4:\r\n			modify PatientsFailedEligibilityDashboardPresenter.DateValueChangeHandler.onValueChange(ValueChangeEvent<Date> event)\r\n				to set all hours,minutes and seconds to be 0, then compare with the lastDate\r\n				and return if they are the same\r\n			this works!!!\r\n		need to find out all places that use FormDateBox , \r\n			to make the same change\r\n			need to create a ticket for it!\r\n','2015-12-21 11:37:24','jliu','2015-12-21 11:37:24',NULL),('196090','66228','ikuznetsova','comment',NULL,NULL,'[~kbartholomae], [~jliu] Kim, I could not find anything about From <date> to <date> filter in description...but I do remember that we have discussed it...will we deploy it?','2015-12-21 12:18:24','ikuznetsova','2015-12-21 12:18:24',NULL),('196112','66228','jliu','comment',NULL,NULL,'\r\nFrom: Bartholomae, Kimberly\r\nSent: 21 December 2015 14:18\r\nTo: Liu, Jamie; Kuznetsova, Irina\r\nCc: Chen, Hanson; Kar, Eric\r\nSubject: RE: VTEN-1515\r\n\r\nThat is correct. \r\n\r\n \r\n\r\nFrom: Liu, Jamie\r\nSent: Monday, December 21, 2015 1:16 PM\r\nTo: Kuznetsova, Irina <ikuznetsova@pulseinc.com>; Bartholomae, Kimberly <kbartholomae@pulseinc.com>\r\nCc: Chen, Hanson <hchen@pulseinc.com>; Kar, Eric <ekar@pulseinc.com>\r\nSubject: RE: VTEN-1515\r\n\r\n \r\n\r\n\r\nI remember Kim had asked to implement the \'from\' and \'to\' dates in the story. So I had implemented this in the code.\r\n\r\n \r\n\r\n \r\n\r\nThank you,\r\n\r\nJamie\r\n\r\nFrom: Kuznetsova, Irina\r\nSent: 18 December 2015 14:42\r\nTo: Bartholomae, Kimberly; Liu, Jamie\r\nCc: Chen, Hanson; Kar, Eric\r\nSubject: RE: VTEN-1515\r\n\r\nHi Kim,\r\n\r\ncould you tell please, do we have only one field/filter (with prompt \'search by patient or user\') on the top?\r\nDo we need filter From <date/time> to <date/time>?\r\n\r\n \r\n\r\nThank you,\r\n\r\nIrina Kuznetsova\r\nSr. QA Analyst\r\n \r\nwww.pulseinc.com','2015-12-21 14:14:43','jliu','2015-12-21 14:14:43',NULL),('196186','66228','jliu','comment',NULL,NULL,'Kim today stated that we don\'t show \'Primary\', \'Secondary\'... wordings for payers, instead, we show numbers like: 1. 2. 3. ....','2015-12-22 09:52:09','jliu','2015-12-22 09:52:09',NULL),('172939','68251','jwang','comment',NULL,NULL,'I think that encounter is still \"unsigned\" if it is signed by resident provider who has supervisor provider. So this is correct. [~Tstroe] please confirm this.','2014-06-04 14:25:55','jwang','2014-06-04 14:25:55',NULL),('173527','68251','mkrishnan','comment',NULL,NULL,'Verified and Passed in QA3.\n Its working fine as per Oana comments.','2014-06-17 07:30:22','mkrishnan','2014-06-17 07:30:22',NULL),('197182','80826','jisaac','comment',NULL,NULL,'not building this server for naming consistency.','2016-01-05 15:10:45','jisaac','2016-01-05 15:10:45',NULL),('126704','42904','rthieszen','comment',NULL,NULL,'I will schedule time this afternoon to work on this.','2015-01-28 16:31:26','rthieszen','2015-01-28 16:31:26',NULL),('126708','42904','rthieszen','comment',NULL,NULL,'Test issue','2015-01-28 16:42:50','rthieszen','2015-01-28 16:42:50',NULL),('172389','68292','jenkinsjirabot','comment',NULL,NULL,'This build was deployed to an environment via DEPLOY BUILD QA3 2.0.','2014-05-26 09:41:52','jenkinsjirabot','2014-05-26 09:41:52',NULL),('196996','80827','jisaac','comment',NULL,NULL,'https://confluence.pulseinc.com/display/TOps/1rst-CTX03+-+Terracom+vCloud+ASP+Build','2016-01-04 15:27:40','jisaac','2016-01-04 15:27:40',NULL),('126438','42783','rthieszen','comment',NULL,NULL,'Building server - vs-cx-bescos','2015-01-23 09:04:25','rthieszen','2015-01-23 09:04:25',NULL),('126442','42783','rthieszen','comment',NULL,NULL,'VM b